import React from 'react';
import logo from '../logo.svg';
import styled from 'styled-components'
import './App.css';
import Header from '../components/header/header.component'
import Profile from './profile'

const AppWrapper = styled.div`
text-align: center;
`

function App() {
  return (
    <div className="App">
      <Header logo = {logo} />
      <Profile />
    </div>
  );
}

export default App;
